import { compose } from "redux";
import { connect } from "react-redux";
import { selectIsCollectionsLoaded } from "../react/shop/shop.selector.js";
import { createStructuredSelector } from "reselect";
import CollectionPage from "./CollectionPage";
import WithSpinner from "../../Components/Collections/with-spinner/with-spinner";

const mapStateToProps = createStructuredSelector({
    isLoaded: (a) => !selectIsCollectionsLoaded(a)
});

const collectionPageWithSpinner = compose(
    connect(mapStateToProps),
    WithSpinner
)(CollectionPage);

export default collectionPageWithSpinner;
